// export default Navbar;

import React from 'react';
import { NavLink } from 'react-router-dom';

const Navbar = () => {
  const handleScroll = (event, sectionId) => {
    event.preventDefault();
    const section = document.getElementById(sectionId);
    section.scrollIntoView({ behavior: 'smooth' });
  };

  return (
    <nav className="navbar">
      <ul className="navbar-nav">
        <li className="nav-item">
          <NavLink to="/" className="nav-link" exact>
            About
          </NavLink>
        </li>
        <li className="nav-item">
          <a href="#skills-section" activeClassName="active" className="nav-link" onClick={(e) => handleScroll(e, 'skills-section')}>
            Skills
          </a>
        </li>
        <li className="nav-item">
          <a href="#projects-section" activeClassName="active" className="nav-link" onClick={(e) => handleScroll(e, 'projects-section')}>
            Projects
          </a>
        </li>
        <li className="nav-item">
          <a href="#experience-section" activeClassName="active" className="nav-link" onClick={(e) => handleScroll(e, 'experience-section')}>
            Experience
          </a>
        </li>
      </ul>
    </nav>
  );
};

export default Navbar;
